import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Chat from './components/Chat';
import Join from './components/Join';

function App() {
    return (
        <Routes>
            <Route path="/" exact component={Join} />
            <Route path="/chat" exact component={Chat} />
        </Routes>
    );
}

export default App;

